import { useEffect, useState } from "react";
import {Card, Col, Row, Container} from 'react-bootstrap';
import { useNavigate } from "react-router-dom";

const { Meta } = Card;

const Dogs = () => {
    const apiUrl = 'https://api.thedogapi.com/v1/breeds?limit=172&page=0';
    const apiKey = 'live_YofICKhS5rzVW9ntbmlFH90L7hHJr6uYB8QG3jUKinPyZoGquMS9LsBPbM2QKoKM';

    const [dogs, setCats] = useState({});
    // const navigate = useNavigate()

    const requestCats = async () => {
        const requestOptions = {
            method : "GET",
            headers : { 
                "Content-Type" : 'application/json',
                'x-api-key' : apiKey,
            },
        };
        fetch (apiUrl, requestOptions)
         .then(response => response.json())
         .then(dogs=>setCats(dogs)); 
    }

    useEffect(() => {
        requestCats();
      }, []);    

    return (
        <>
            <div className='Card'  >                
            {data.map((item) =>
                <button  key={item.id}  onClick={() => {
                    console.log({item});
                    navigate(`/about/${item.id}`);
                }}>
                    
                <Card   hoverable style={{ width: 240}}
                cover={
                    <img alt="LOADING" src={item.url}/>
                }>
            <Meta title={item.breeds.map((x) => x.name)} />
            </Card>
            </button>        
            )}
            
            </div>         
        </>
    )
};

export default Dogs;
